import React, { Component } from 'react';
import './App.css';
import Home from './Home';
import { BrowserRouter, Route, Link, Router, Switch } from "react-router-dom";
import PrivacyPolicy from './PrivacyPolicy';
import UsageTutorial from './UsageTutorial';
import Support from './Support';


class App extends Component {
  render () {
    return (
      <Router>
        <div className="App">
          <div className= "App-top">
            <h1 className="App-name"> Simple OKRs </h1>
          </div>
          <Switch>
            <Route exact path = '/' component={Home} />
            <Route exact path = '/usage' component={UsageTutorial} />
            <Route exact path = '/support' component={Support} />
            <Route exact path = '/privacy-policy' component={PrivacyPolicy} />
          </Switch>
        </div>
      <footer>
        <div className="footer">
          <a> <Link to={'/usage'}>Usage</Link></a> 
          <a> <Link to={'/support'}>Support</Link></a> 
          <a> <Link to={'/privacy-policy'}>Privacy Policy</Link></a> 
        </div>
      </footer>
    </Router>
    )
  }
}

export default App;
